import React, { useState, useEffect } from 'react';

function Home() {

const Home = () => {
    useEffect(() => {
        document.title = 'Home';
    });

    return (
        <div>
            <h1>Wildfire Tracker</h1>
            <p>This is home page</p>

        </div>
    );
}}
export default Home;
